import React from 'react';
import { useNavigate } from 'react-router-dom';
import useProfileStore from '../../store/profileStore';
import './TeamsWithProposalPage.css';

const TeamsWithProposalPage = () => {
  const navigate = useNavigate();
  const { teamsWithProposals } = useProfileStore();

  return (
    <div className="room-page">
      <div className="room-header">
        <div className="header-content">
          <div className="room-info">
            <h1>Research Proposals</h1>
            <p className="creator-info">
              {teamsWithProposals.length} {teamsWithProposals.length === 1 ? 'proposal' : 'proposals'} generated
            </p>
          </div>
          <div className="header-actions">
            <button 
              onClick={() => navigate('/')} 
              className="secondary-button"
            >
              ‚Üê Back to Home
            </button>
          </div>
        </div>
      </div>

      <div className="content-container">
        {teamsWithProposals.length === 0 ? (
          <div className="empty-state">
            <div className="empty-icon">
              <span role="img" aria-label="Research">üìë</span>
            </div>
            <h3>No Proposals Available</h3>
            <p>Generate team proposals to view them here</p>
            <button 
              onClick={() => navigate('/teams')} 
              className="primary-button"
            >
              Go to Teams
            </button>
          </div>
        ) : (
          <div className="proposals-list">
            {teamsWithProposals.map((team, index) => (
              <div key={team.team_id} className="proposal-card">
                <div className="proposal-header">
                  <h2>Proposal #{index + 1}</h2>
                  <span className="score-badge">
                    Team Score: {team.proposal_score || 'N/A'}
                  </span>
                </div>

                <div className="proposal-content">
                  <p className="proposal-text">{team.proposal_description}</p>

                  <div className="team-info">
                    <h3 className="section-title">Team Members:</h3>
                    <div className="members-container">
                      {team.members.map((member) => (
                        <div key={member} className="member-chip">
                          <span className="member-name">{member}</span>
                          <span className="member-expertise">
                            {team.member_fields[member].join(', ')}
                          </span>
                        </div>
                      ))}
                    </div>
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default TeamsWithProposalPage;
